import './App.css';
import logo from  './logo_biblioteca.jpg';
import icon_perfil from './icon_perfil.jpg';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import Libros from './components/Libros';
import Top from "./components/Top";

console.log(icon_perfil);

console.log(logo);

function App() {
  return (

    <Routes>

      <Top/>

      <Route path='/' exact>
        <Top/>
      </Route>

      <Route path='/Libros' exact>

        <Libros/>
      </Route>

    </Routes>
  );
}


export default App;
